import React from 'react';
import './todo-list-item.css'
const TodoListItem = ({ label, important = false }) => { // instead of label 
    //could be props
    const listStyle = {
        color: important ? 'tomato' : 'blue'
    };
    return <span style={listStyle}> {label} </span>;// instead of that coulld be props.label
};// but because of destructurization syntax we can use already properties

export default TodoListItem;
